class  Login extends Component { 
  constructor(props){
    super(props)
    this.state ={
      email:'',
      password:''
    }
  }
  changeHandler = (e) => {
    this.setState({[e.target.name]:e.target.value})
  }
  submitHandler  =e =>{
    e.preventDefault()
    console.log(this.state)
    axios.post('http://192.168.8.101:3001/api/auth/login',this.state)
    .then(response =>{
      console.log(response)
    })
    .catch(error => {
      console.log(error)
    })
  }

  render(){
    const {email,password} = this.state

  return(
    <div className="bar">
   <Form onSubmit ={this.submitHandler} className ="login-form">
   <h1 className="font-weight-bold"> mywebside.com  </h1>
   <h2>Welcome</h2>
   <FormGroup>
    <Label>Email</Label>

     <input type="email" placeholder="Email" name ="email" value ={email} onChange={this.changeHandler}></input>
    </FormGroup>
    <FormGroup>
    <Label>Password</Label>
     <input type="password" placeholder="Password"  name  ="password" value ={password } onChange={this.changeHandler}></input>
    </FormGroup>
    <Button type ="submit" className="btn-lg btn-dark btn-block">Login</Button>
    <Link to ="/Webfrontend/src/Components/Register.js">Register</Link>
  </Form>
  </div>

  );
  }
}
)
}
export default Login;
